            Program.richPrecense.Assets.LargeImageKey = "Current Country";
            Program.richPrecense.Timestamps = new Timestamps();
            Program.richPrecense.Timestamps.Start = Program.startTime;
            Program.rpcClient = new DiscordRpcClient("1085647354641780868");
            Program.rpcClient.OnReady += initTelemetry;
            Program.rpcClient.Initialize();
            Console.WriteLine("Created Callback Handler");
        }

