        public void onTelemetryData(Ets2Telemetry data, bool newTimestamp)
        {
            var oCities = JsonConvert.DeserializeObject<City[]>(cities);
            var closestCity = "";
            var closestCountry = "";
            var closestDistance = 999999999999.9;
            foreach (var c in oCities)
            {
                var distance = Math.Sqrt(Math.Pow(data.Physics.CoordinateX - c.x, 2) + Math.Pow(data.Physics.CoordinateZ - c.z, 2));
                if (distance < closestDistance)
                {
                    closestCity = c.realName;
                    closestCountry = c.country;
                    closestDistance = distance;
                }
            }

            if (countryImageKeys.ContainsKey(closestCountry))
            {
                closestCountry = countryImageKeys[closestCountry];
            }
            if (closestCountry == "uk")
            {
                closestCountry = "united_kingdom";
            }
            var countryName = textInfo.ToTitleCase(closestCountry.Replace("_", " "));

            var sbState = new StringBuilder();
            var sbDetails = new StringBuilder();

            sbDetails.AppendFormat("🚚 {0} {1} ({2:0}%) - ", data.Manufacturer, data.Truck, data.Damage.WearCabin * 100);
            if (!data.Drivetrain.EngineEnabled || data.Drivetrain.Speed < 1)
            {
                sbDetails.Append(" Stopped");
            }
            else
            {
                sbDetails.AppendFormat("{0:0} km/h", data.Drivetrain.SpeedKmh);
            }

            if (data.Job.OnJob)
            {
                Program.richPrecense.Timestamps.Start = null;
                Program.richPrecense.Timestamps.End = DateTime.UtcNow.AddSeconds((ulong)data.Job.NavigationTimeLeft);
                sbState.AppendFormat("{0} ({1} t): {2} ➡ {3} - {4:0} km left", data.Job.Cargo, Math.Floor(data.Job.Mass / 1000), data.Job.CitySource, data.Job.CityDestination, data.Job.NavigationDistanceLeft / 1000);
            }
            else
            {
                Program.richPrecense.Timestamps.Start = Program.startTime;
                Program.richPrecense.Timestamps.End = null;
                sbState.AppendFormat("📍 {1}, {0}", countryName, closestCity);
            }

            Program.richPrecense.Details = sbDetails.ToString();
            Program.richPrecense.State = sbState.ToString();
            Program.richPrecense.Assets = new Assets()
            {
                LargeImageKey = closestCountry,
                LargeImageText = countryName,
                SmallImageKey = data.ManufacturerId.ToLower(),
                SmallImageText = $"{data.Manufacturer} {data.Truck}",
            };
            Program.rpcClient.SetPresence(Program.richPrecense);
        }
    }

    struct City
    {
        public string gameName;
        public string realName;
        public string country;
        public float x;
        public float y;
        public float z;
    }
